import React from 'react';
import './App.css';
import styled from 'styled-components';

const MainContainer = styled.div`
  margin: 0;
  padding: 0;
  display:flex;
  justify-content: center;
  height: 65vh;
`;

const EstiloDiv = styled.div`
  margin: 1%;
  width: 384px;
  height: 100%;

`;

const EstiloH1 = styled.h1`
  color: #DC143C;
`;

function App() {
  return (
    <div className="App">
      <MainContainer/>
      <EstiloDiv/>
      <EstiloH1> Lista de Tarefas </EstiloH1>
    </div>
  );
}

export default App;
